import React from 'react'

interface PrinterProps {
  text: string
}

const Printer: React.FC<PrinterProps> = ({ text }) => {
  console.log('Рендерим Printer')
  const textLength = (text: string): number => {
    console.log('Вычисляем длину строки ...')
    return text.length
  }
  return (
    <div>
      Текст: {text}, длина текста: {textLength(text)}
    </div>
  )
}

export default React.memo(Printer)
